from collections import defaultdict, deque

class Solution:
    def numMatchingSubseq(self, s, words):
        waiting = defaultdict(deque)
        for w in words:
            waiting[w[0]].append(iter(w[1:]))
        count = 0
        for c in s:
            for it in list(waiting[c]):
                waiting[c].popleft()
                nxt = next(it, None)
                if nxt:
                    waiting[nxt].append(it)
                else:
                    count += 1
        return count
